            <div className="column is-4 is-offset-4">
            <div className="notification is-danger">
              <button className="delete"></button>
              { this.props.message }
            </div>
          </div>
          )
      }else {
    return (
      <div className="content-wrapper">
        <section className="content-header">
          <div className="row">
            <div className="col-md-12">
