               <div className="col-md-3">
              <a href="#">
                                      <i className="fa fa-files-o"></i>
                                      <span>Patient Name</span>
                                      <span className="pull-right-container">
                                      <span className="label label-primary pull-right">4</span>
                                      </span>
                                  </a>
              <ul>
                {
                    this.props.patientData.map((data)=>

